import React from 'react';
import Login from './Login';
import AppBarComponent from './components/AppBarComponent';
import HeroSection from './components/HeroSection';


const App = () => {
  return (
    <div>
      <AppBarComponent/>
      <HeroSection/>
      <Login />
    </div>
  );
}

export default App;
